import React, { Component } from "react";
import styled from "styled-components";

/* Images */
import Image1 from "../images/turkishseries/r1.png";
import Image2 from "../images/turkishseries/r2.png";
import Image3 from "../images/turkishseries/r3.png";
import Image4 from "../images/turkishseries/r4.png";

class SeriesTurkish extends Component {
  render() {
    return (
      <Series className="container">
        <div className="col-12">
          <h5>Özel Yapımlar ve Daha Fazlası</h5>
          <div className="grid-container">
            <div className="item1">
              <img src={Image1} />
            </div>

            <div className="item2">
              <img src={Image2} />
            </div>

            <div className="item3">
              <img src={Image3} />
            </div>

            <div className="item4">
              <img src={Image4} />
            </div>
          </div>
        </div>
      </Series>
    );
  }
}

const Series = styled.div`
  h5 {
    font-family: Work Sans;
    font-size: 1.2rem;
  }

  .grid-container {
    display: grid;
    justify-content: center;
    grid-template-columns: auto auto auto auto;
    grid-gap: 1rem;
  }

  img {
    vertical-align: middle;
    width: 100%;
  }
`;

export default SeriesTurkish;
